import s from './filmElem.module.css'

const FilmElem = (props) =>{
  return (
    <div className={s.filmElem}>
      <div className={s.filmImg}>{props.photo}</div>
      <div className={s.details}>{props.details}</div>
      <div className={s.rating}>{props.rating}</div>
    </div>
  )
}

export default FilmElem;
